INSERT INTO `travel_package` VALUES (3,'af983e92-2bcc-4d87-9e5a-a9d38470106f','2024-12-03 16:12:38','af983e92-2bcc-4d87-9e5a-a9d38470106f','2025-03-20 15:26:54','Japan Cultural Experience','977f3d0a-f2fb-4800-9835-d5f617d448d8','377f5e70-17c1-43c5-b7c2-13c4b485a66c','2024-12-10','2024-12-31','Embark on a journey to explore the timeless beauty and rich heritage of Japan. This cultural experience takes you through Japan\'s iconic landmarks, ancient traditions, and modern marvels. From the tranquil shrines of Kyoto to the bustling streets of Osaka, immerse yourself in the vibrant culture, breathtaking scenery, and unmatched hospitality of this incredible country. Perfect for history enthusiasts, nature lovers, and foodies, this package ensures a memorable and enriching experience.',6,7,3,8599),(13,'af983e92-2bcc-4d87-9e5a-a9d38470106f','2024-12-10 05:59:05','af983e92-2bcc-4d87-9e5a-a9d38470106f','2025-03-19 18:10:01','Explore Taiwan: Culture, Nature, and Urban Wonders','1dbe9b5d-6a1a-408d-8bd6-dbbd18af3983','d1063c30-54da-4dd7-ad48-0f9244aa2d30','2024-12-10','2024-12-20','Immerse yourself in the diverse culture of Taiwan, from vibrant cities to tranquil countryside landscapes. This 5-day itinerary covers bustling night markets, iconic landmarks, serene mountains, and rich cultural sites, providing the ultimate Taiwan experience.',4,5,5,7499);
